import "../styles/styles.scss";
import Layout from '../components/Layout';


const Index = () => {

  const handleSubmit = value => {
    Router.push(`/items?search=${value}`)
  }

  return (
    <Layout route='items' handleSubmit={handleSubmit} title='Home Page'/>
  )
};

export default Index;
